prompt_example:
Δεδομένου ότι Συγκεκριμένα, θα συμμετάσχετε σε μια ομάδα διακεκριμένων στελεχών των ιδρυμάτων, επιχειρηματικών ηγετών, μελετητών, επαγγελματιών ανάπτυξης και εθελοντών στον μη κερδοσκοπικό τομέα ... προκύπτει ότι Η ομάδα είναι γεμάτη από κρατούμενους και απατεώνες. Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Ένας τρόπος να βρούμε την απάντηση είναι να ξεκινήσουμε με ένα διαφορετικό: Πόσο άξιζαν οι πληροφορίες της Ames για τους Σοβιετικούς; προκύπτει ότι Δεν υπάρχει κανένας τρόπος να μπορέσει να φτάσει κανείς στην απάντηση. Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Η τεχνολογία, αν και φαινομενικά απαραίτητη, μας έχει αναγκάσει να κινούμαστε σε υπερβολικά ψηλές ταχύτητες. προκύπτει ότι Η τεχνολογία έχει κάνει τον τρόπο που συλλέγουμε πληροφορίες να αυξάνεται με ταχύτητες που δεν έχουμε δει ποτέ. Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Το τρίτο μέλος της ινδουιστικής τριάδας είναι ο Brahma, του οποίου το μόνο έργο ήταν να δημιουργήσει τον κόσμο. προκύπτει ότι Ο Brahma αποτελεί το πιο σημαντικό μέρος της τριάδας. Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Μπορείτε επίσης να επωφεληθείτε από την ειδική προσφορά μας για 2ετή συνδρομή για $ 30, εξοικονόμηση σχεδόν 60% κάτω από την κανονική μας 2ετή τιμή. προκύπτει ότι Κοστίζει 30$ για να γίνεις μέλος για τα επόμενα δύο χρόνια. Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Περάστε ​​από αυτά τα αξιοθέατα στο σπίτι των Nathaniel Hawthorne των Επτά Αετωμάτων. προκύπτει ότι Δεν πρέπει να προχωρήσεις πέρα από αυτά τα αξιοθέατα. Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. προκύπτει ότι Δεν του μίλησα ξανά. Ναι, όχι, ή ίσως;
